from pybricks.hubs import PrimeHub
from pybricks.parameters import Direction, Port, Stop
from pybricks.pupdevices import Motor
from pybricks.robotics import DriveBase
from pybricks.tools import multitask, run_task, wait

# Set up all devices.
prime_hub = PrimeHub()
motor = Motor(Port.A, Direction.CLOCKWISE)
motor2 = Motor(Port.B, Direction.COUNTERCLOCKWISE)
front = Motor(Port.E, Direction.COUNTERCLOCKWISE)
back = Motor(Port.F, Direction.CLOCKWISE)
drive_base = DriveBase(motor2, motor, 81.6, 101.7182)

async def main():
    drive_base.settings(straight_speed=500)
    drive_base.use_gyro(True)
    await drive_base.straight(-100)
    await drive_base.turn(-10)
    await drive_base.straight(-450)
    await drive_base.curve(5, 39)
    await drive_base.straight(-170)
    await back.run_angle(900, 450)
    # right collection is done now
    drive_base.settings(straight_speed=200)
    await drive_base.turn(-125)
    await drive_base.straight(-100)
    await front.run_angle(900, -400)
    await drive_base.straight(40)
    await front.run_angle(900, 100)
    await drive_base.straight(-100)
    await front.run_angle(900, 100)
    await multitask(drive_base.straight(-5), front.run_angle(900, 100))
    await drive_base.turn(8)
    await drive_base.straight(-255)
    await drive_base.turn(45)
    await drive_base.straight(-130)
    # arrive at the submersible stand(has not done yet)
    await back.run_angle(900, -600)
    await drive_base.straight(30)
    await multitask(back.run_angle(900, 500), front.run_angle(900, -30))
    # done with poultry(chicken) submarine
    await drive_base.turn(90)


run_task(main())